import React from 'react';


class Pokemon extends React.Component {


    state = {
        "pokemons-faction1": [
            {
                Name: "Pikachu",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 1
            },
            {
                "Name": "Bulbasaur",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 1
            },
            {
                "Name": "Snorlax",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 1
            }
        ],
        "pokemons-faction2": [
            {
                "Name": "Charizard",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 1
            },
            {
                Name: "Mewtwo",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 1
            },
            {
                Name: "Ditto",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 1
            }
        ]
    }
    render() {
        return (
            <div>
                {console.log(this.state['pokemons-faction1'][0].Name)}
                <h1 className="display-1">Faction 1</h1>

                    <div id="faction-1">

                        <ul class="list-group">
                        {this.state['pokemons-faction1'].map(pokemon => (
                            <li className="list-group-item" key = {pokemon.id}> {pokemon.Name} </li>
                        ))}
                        </ul>
                    </div>



            </div>
        );
    }
};


export default Pokemon;
